import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Icon from '@material-ui/core/Icon';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

//import TextField from '@material-ui/core/TextField';
//import MenuItem from '@material-ui/core/MenuItem';
/* import Grid from '@material-ui/core/Grid'; */
/* import AccountCircle from '@material-ui/icons/AccountCircle'; */

const useStyles = makeStyles((theme) => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: '50ch',
        },
    },
    margin: {
        margin: theme.spacing(1),
    },
}));

export default function GoesEmpresas() {
    const classes = useStyles();
    // const [age] = React.useState('');

    /*   const currencies = [
        {
          value: '',
          label: 'Elegir...',
        },
      ]; */

    return (
        <form className={classes.root} noValidate autoComplete="off">
            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount">Nombre  Empresa*</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    startAdornment={<InputAdornment position="start"> <Icon className="text-30" color="action">
                        blur_circular
								</Icon>
                    </InputAdornment>}
                />
            </FormControl>
            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount">Nombres*</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
                        person
						</Icon></InputAdornment>}
                />
            </FormControl>
        </form>
    );
}
